// This is About component, It will contain about us info.
import React from "react";
import "./Steps.css"

const Terms = () => {
  return <div id="terms-container">
      <h1 id="header">Terms of Service</h1>
      <h3 class="terms-header"></h3>

      <p id="terms-text"></p>
  </div>
};

export default Terms;
